import React, { useState } from "react";
import "./projects.css"
import SingleProject from "./singleProject";

const nametemp = "Project 1"
const userstemp = "Tyler"
const HW1numtemp = 10
const HW1dentemp = 50
const HW2numtemp = 5
const HW2dentemp = 15

class Projects extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name: nametemp,
            users: userstemp,
            HW1num: HW1numtemp,
            HW1den: HW1dentemp,
            HW2num: HW2numtemp,
            HW2den: HW2dentemp
        };
    }
    render() {
        return (
            <div className="projcover">
                <h1>Projects</h1>
                <SingleProject name={this.state.name} users={this.state.users} HW1num={this.state.HW1num} HW1den={this.state.HW1den} HW2num={this.state.HW2num} HW2den={this.state.HW2den} />
            </div>
        )
    }
}

export default Projects
